import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the cart element
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear and take screenshot
    await page.waitForSelector('.modal', { timeout: 5000 });
    await page.waitForSelector('.cart-content', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Extract cart data
    const cartTitle = await page.$eval('.cart-content h2', el => el.textContent.trim());
    const cartItems = await page.$$eval('.cart-item', items => items.length);
    const isEmpty = await page.$('.empty-cart') !== null;

    return {
      success: true,
      action: "Opened shopping cart modal",
      extractedData: {
        cartTitle,
        cartItems,
        isEmpty
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
